    //AutoCompletionExtender reset position
    function resetPosition(object, args) {
        var tb = object._element;
        var ex = object._completionListElement;

        var eTop = $('#JobSearchLocationTextBox').offset().top;
        var sTop = $(window).scrollTop();
        var pcent = eTop - sTop;

        if (pcent < 600) return;

        var tbposition = findPositionWithScrolling(tb);
        var xposition = tbposition[0];
        var yposition = tbposition[1] - (10 * ex.children.length) - (18 * ex.children.length);
        if (ex)
            $common.setLocation(ex, new Sys.UI.Point(xposition, yposition));
    }

    function findPositionWithScrolling(oElement) {
        if (typeof (oElement.offsetParent) != 'undefined') {
            var originalElement = oElement;
            for (var posX = 0, posY = 0; oElement; oElement = oElement.offsetParent) {
                posX += oElement.offsetLeft;
                posY += oElement.offsetTop;
                if (oElement != originalElement && oElement != document.body && oElement != document.documentElement) {
                    posX -= oElement.scrollLeft;
                    posY -= oElement.scrollTop;
                }
            }
            return [posX, posY];
        } else {
            return [oElement.x, oElement.y];
        }
    }

    function showAccordion() {
        var viewPortWidth = document.documentElement.clientWidth;
        if (viewPortWidth < 768) {
            $('.collapse').removeClass('show-me');
            $('.hide-me-anchor').removeClass('hide-me');
        }
        else
        {
            $('.collapse').addClass('show-me');
            $('.hide-me-anchor').addClass('hide-me');
        }
    }

    $(window).resize(showAccordion);
    showAccordion();

